import React from 'react';
import ReactDOM from 'react-dom';
const fname = "Rahul";
const lname = "Rathore";
ReactDOM.render(
  <>
  <h1>My First Name is : {`${fname}`}</h1>
  <h1>My Last Name is : {`${lname}`}</h1>
  </>,
  document.getElementById('root')
);
